// this line should not be removed
/* Samples Gallery wKnob3 Widget, this widget demonstrates the Dynamic use of Knobs with other DreamFace GCs such as sliders and static text */
var wKnob1 = angular.module( "wKnob3",[]);

wKnob1.controller( "wKnob3Controller", function( $scope, $timeout ) {
/*Defining myDelay function, this will update second_mdl, minute_mdl, hour_mdl every 1000 Milliseconds (one second)*/
    $scope.myDelay = function() {
        //defining javascript Date object for this moment
        var d = new Date();
        //getting the values of seconds, minutes and hours from the date object and store in in angular properties
        $scope.second_mdl = d.getSeconds();
        $scope.minute_mdl = d.getMinutes();
        $scope.hour_mdl = d.getHours();
        //calling myDelay function again after setiing a 100 millliseconds timeout using angular $timeout
        $timeout(function() {
            $scope.myDelay();
        }, 1000);
    }
    //calling myDelay function when widget starts.
    $scope.myDelay();
});
